import React from "react";

import { connect } from "react-redux";

const DifficultyButton = ({ level, name, getQuestions }) => {
  return <button className="button-difficulty">{level}</button>;
};

const mapStateToProps = (state) => {
  return state;
};

export default connect(mapStateToProps, {})(DifficultyButton);
